import React, { useState } from 'react';

const BuyingPage = () => {
    const [quantity, setQuantity] = useState(1);
    const [selectedVariant, setSelectedVariant] = useState('Default Variant');
    const [showSummary, setShowSummary] = useState(false);

    const handleQuantityChange = (e) => {
        const value = parseInt(e.target.value, 10);
        setQuantity(value > 0 ? value : 1);
    };

    const handleVariantChange = (e) => {
        setSelectedVariant(e.target.value);
    };

    const handleBuyNow = () => {
        setShowSummary(true);
    };

    return (
        <div style={{ fontFamily: 'Arial, sans-serif', padding: '20px', maxWidth: '600px', margin: '0 auto' }}>
            {showSummary ? (
                <div>
                    <h1>Order Summary</h1>
                    <p><strong>Variant:</strong> {selectedVariant}</p>
                    <p><strong>Quantity:</strong> {quantity}</p>
                    <p><strong>Total Price:</strong> ${(quantity * 50).toFixed(2)} (Assuming $50 per item)</p>

                    <div style={{ marginTop: '20px' }}>
                        <h2>Shipping Information</h2>
                        <p>Please enter your shipping details below:</p>
                        <form style={{ display: 'grid', gap: '10px' }}>
                            <input type="text" placeholder="Full Name" required style={{ padding: '10px', fontSize: '16px' }} />
                            <input type="text" placeholder="Address" required style={{ padding: '10px', fontSize: '16px' }} />
                            <input type="text" placeholder="City" required style={{ padding: '10px', fontSize: '16px' }} />
                            <input type="text" placeholder="Postal Code" required style={{ padding: '10px', fontSize: '16px' }} />
                            <input type="text" placeholder="Phone Number" required style={{ padding: '10px', fontSize: '16px' }} />
                            <button type="submit" style={{ padding: '10px 20px', fontSize: '16px', backgroundColor: '#28A745', color: '#fff', border: 'none', borderRadius: '5px', cursor: 'pointer' }}>
                                Confirm Order
                            </button>
                        </form>
                    </div>
                </div>
            ) : (
                <div>
                    <h1>Buy Your Favorite Product</h1>

                    <div style={{ marginBottom: '20px' }}>
                        <label style={{ display: 'block', marginBottom: '5px' }}>Select Variant:</label>
                        <select 
                            value={selectedVariant} 
                            onChange={handleVariantChange} 
                            style={{ padding: '5px', fontSize: '16px' }}
                        >
                            <option value="Default Variant">Default Variant</option>
                            <option value="Premium Variant">Premium Variant</option>
                            <option value="Budget Variant">Budget Variant</option>
                        </select>
                    </div>

                    <div style={{ marginBottom: '20px' }}>
                        <label style={{ display: 'block', marginBottom: '5px' }}>Quantity:</label>
                        <input 
                            type="number" 
                            value={quantity} 
                            onChange={handleQuantityChange} 
                            style={{ padding: '5px', fontSize: '16px', width: '80px' }}
                        />
                    </div>

                    <button 
                        onClick={handleBuyNow} 
                        style={{ padding: '10px 20px', fontSize: '16px', backgroundColor: '#007BFF', color: '#fff', border: 'none', borderRadius: '5px', cursor: 'pointer' }}
                    >
                        Buy Now
                    </button>
                </div>
            )}
        </div>
    );
};

export default BuyingPage;
